import React from 'react';
import './Category.css';

const Category = () => {
    return (
        <div className='category-container'>
            <div className="filter">Filter</div>
            <div className="type">Kategori</div>
            <div className="brand">Merke</div>
            <div className="price">Price</div>
        </div>
    )
}

export default Category;
